import React, { useContext} from 'react';
import Navigation from '../components/Navigation';

import IsometricBlock from '../components/IsometricBlock';
import { DiJavascript } from 'react-icons/di';
import { DiHtml5 } from 'react-icons/di';
import { DiCss3Full } from 'react-icons/di';
import { DiReact } from 'react-icons/di';
import ParametresBanner from '../components/ParametresBanner';
import LanguageContext from '../components/LanguageContext';

const Home = () => {

    const language = useContext(LanguageContext);

    return (
        <div className="home">
            <Navigation/>
            <ParametresBanner/>
            <div className="container ">

                <header>
                    <h1>{language.language === "Shakespeare" ? 'Front-end developer' : 'Developpeur front-end' }</h1>
                    <h2>Klipfel Nicolas</h2>
                </header>

                <div className="technos">
                    <ul>
                        <IsometricBlock language={'Html'} icon={ DiHtml5 } color={"#e34b20"} number={10}/> 
                        <IsometricBlock language={'Css'} icon={ DiCss3Full } color={"#2187d2"} number={8}/>
                        <IsometricBlock language={'Javascript'} icon={ DiJavascript} color={"yellow"} number={7}/>
                        <IsometricBlock language={'React'} icon={ DiReact } color={"#53d2fa"} number={5}/>
                    </ul>
                </div>
            </div> 
        </div>


    );
};

export default Home;
